  - - '2'
    - "Диплом"
    - '2015-11-16 15:11:47.732234'
    - '2016-02-22 09:41:43.458761'
    - "Грамотно написанный дипломный проект, сделанный с учетом требований преподавателя,
      предполагает наличие отличной теоретической подготовки и качественного оформления
      практических данных. Мы готовы взять на себя рутинный скрупулезный труд, предоставив
      вам окончательный результат в строго оговоренный срок, проконсультировать по
      возникшим вопросам и сопровождать вас до благополучной защиты работы."
