  - - '3'
    - "Реферат"
    - '2015-11-16 15:11:52.377981'
    - '2016-02-22 09:39:52.499166'
    - "Реферат – плод многодневного труда, полученный путем изучения и анализа большого
      количества литературных источников. Чужие мысли должны быть не просто систематизированы,
      но и подкреплены собственными выводами и заключениями. Благодаря многочисленным
      сервисам проверки уникальности, скачать реферат из интернета и выдать его за
      собственное детище достаточно сложно. Наши работы – индивидуальны, каждая из
      них прошла проверку и написана специально для вас."
