questions:
  columns:
  - id
  - question
  - answer
  - created_at
  - updated_at
  - date
  records:
  - - '2'
    - "Какие вы предоставляете гарантии?"
    - "Каждый клиент может заключить с нами официальный договор. На все выполненные
      работы мы предоставляем гарантию. Работы выполняют практикующие преподаватели
      по Вашему предмету. Каждая работа проходит контроль качества и проверку в Etxt
      Антиплагиат."
    - '2015-12-28 13:30:51.367686'
    - '2015-12-28 13:30:51.367686'
    -
  - - '3'
    - "Могу ли я лично общаться с автором моей работы?"
    - "Вы общаетесь с автором работы в режиме онлайн через чат в вашем личном кабинете.
      Это позволяет Вам контролировать процесс написания работы и вовремя вносить
      возможные корректировки."
    - '2015-12-28 13:31:10.670946'
    - '2015-12-28 13:31:10.670946'
    -
  - - '4'
    - "Как вам можно заплатить?"
    - "На сайте компании вы можете ознакомиться с большим выбором способов оплаты
      и подобрать наиболее подходящий для Вас."
    - '2015-12-28 13:32:13.604974'
    - '2015-12-28 13:32:13.604974'
    -
  - - '5'
    - "Обязательно ли Вам предоставлять методические указания нашего Вуза?"
    - "Если в Вашем университете требуется стандартное оформление по ГОСТу, то методические
      указания не обязательны."
    - '2015-12-28 13:51:29.074519'
    - '2015-12-28 13:51:29.074519'
    -
  - - '6'
    - "Делаете ли вы бесплатные доработки и в какой срок?"
    - "Мы предоставляем гарантию на каждую работу, поэтому все доработки производятся
      бесплатно."
    - '2015-12-28 13:51:44.417227'
    - '2015-12-28 13:51:44.417227'
    -
  - - '7'
    - "Можно ли сделав заказ дипломной работы получать и оплачивать ее по частям?"
    - "Мы работаем по принципу внесения 25% предоплаты при заказе работы и оплате
      оставшейся суммы после выполнении работы и Вашего ознакомления с ее частью."
    - '2015-12-28 13:52:06.009783'
    - '2015-12-28 13:52:06.009783'
    -
  - - '8'
    - "Если нет плана работы, можете ли вы мне его составить для утверждения у руководителя.
      Эта услуга входит в стоимость?"
    - "Мы бесплатно составляем Вам план для утверждения у вашего руководителя, при
      условии заказа работы."
    - '2015-12-28 13:52:37.288448'
    - '2015-12-28 13:52:37.288448'
    -
  - - '9'
    - "Кем является автор моей работы?"
    - "Наши авторы - это практикующие преподаватели, доценты, кандидаты и доктора
      наук. Мы не работаем со студентами."
    - '2015-12-28 13:52:56.350622'
    - '2015-12-28 13:52:56.350622'
    -
  - - '10'
    - "Можете ли вы исправить уже написанную мной работу или помочь с оформлением?"
    - "Да, мы предоставляем данную услугу. Для этого Вам необходимо предоставить нам
      методические указания и замечания вашего руководителя."
    - '2015-12-28 13:53:16.978401'
    - '2015-12-28 13:53:16.978401'
    -
  - - '11'
    - "Как я получу готовую работу?"
    - "Все работы предоставляются в электронном виде. Мы отправим Вам ее в Ваш личный
      кабинет на нашем сайте."
    - '2015-12-28 13:53:43.412057'
    - '2015-12-28 13:53:43.412057'
    -
  - - '12'
    - "Как узнаю, что работа готова?"
    - "После того, как работа будет выполнена, менеджер свяжется с вами, также она
      станет доступна в вашем личном кабинете."
    - '2015-12-28 13:54:02.144208'
    - '2015-12-28 13:54:02.144208'
    -
  - - '13'
    - "Как мне зайти в личный кабинет?"
    - "Для этого Вам необходимо сделать хотя заказ через форму на сайте, и система
      автоматически создаст для Вас личный кабинет. Далее Вы сможете зайти в него
      с помощью логина и пароля , высланных к Вам на почту."
    - '2015-12-28 13:54:20.009308'
    - '2015-12-28 13:54:20.009308'
    -
  - - '14'
    - "Как я могу узнать на каком этапе выполнения находится мой заказ?"
    - "Эту информацию можно увидеть в личном кабинете."
    - '2015-12-28 13:54:37.84897'
    - '2015-12-28 13:54:37.84897'
    -
  - - '15'
    - "Как я узнаю, что заказ готов?"
    - "Мы уведомим Вам об этом в личном кабинете, по электронной почте и смс."
    - '2015-12-28 13:54:54.64711'
    - '2015-12-28 13:54:54.64711'
    -

